import React from 'react'

const Card = () => {
	return(
		
		<div className='bg-light-green dib br4 pa3 ma2 grow bw-2 shadow-5'>
			<img alt='robots' src='https://robohash.org/batman?size=200x200' />
			<div>
				<h1>Batman</h1>
				<p>batman.official.com</p>
			</div>
		</div>
	)
};

export default Card
